interface IHash {
    [socketid : string] : RTCPeerConnection
}

const userInfos = {
    pc : new Map<string, RTCPeerConnection>()

};

export default (state = userInfos, action: any) => {
    switch (action.type) {
        case "ADD_PC":
            return {
                pc: action.pc,
            };
        default:
            return state;
    }
};
